import styled from "styled-components";

function HabitoSalvo () {
    return (
        <>
            <Container>
             <h1>Habito do servidor</h1>
            </Container>
    </>
    )
}

const Container = styled.div`
    width: 340px;
    height: 910px;
    border-radius: 5px;
    margin: 0 auto;
    margin-bottom: 28px;
    background-color: #FFFFFF;

        input {
            width: 303px;
            height: 45px;
            font-size: 20px;
            color: var(--cor-cinza-input);
            border-radius: 5px;
            border: 1px solid var(--cor-cinza-borda);
            margin: 18px 19px;
            padding-left: 11px;
        }
`

const DayWeek = styled.button`
    font-size: 19px;
    color: var(--cor-cinza-borda);
    width: 30px;
    height: 30px;
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 5px;
    border: 1px solid var(--cor-cinza-borda);
    margin-left: 19px;
    margin-right: 1px;
    background-color: gray; 
`

const Days = styled.div`

    display: flex;
    padding-right: 50px;
    background-color: blue;
`
export default HabitoSalvo;
